import axios from 'axios';

// User APIs
export const registerUser = async (userData) => {
    const response = await axios.post('/api/users', userData);
    return response.data;
};

export const loginUser = async (username, password) => {
    const response = await axios.post('/api/users/login', { username, password });
    return response.data;
};

// Car APIs
export const fetchCarsByUser = async (userId) => {
    const response = await axios.get(`/api/cars?userId=${userId}`);
    return response.data;
};

export const addCar = async (carData) => {
    const response = await axios.post('/api/cars', carData);
    return response.data;
};

export const updateCar = async (carId, updatedCarData) => {
    const response = await axios.put(`/api/cars/${carId}`, updatedCarData);
    return response.data;
};

export const deleteCar = async (carId) => {
    const response = await axios.delete(`/api/cars/${carId}`);
    return response.data;
};

export const searchCars = async (keyword) => {
    const response = await axios.get(`/api/cars/search?keyword=${keyword}`);
    return response.data;
};
